// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9; // >=0.8.0 has SafeMath built-in

contract FlightSuretyData {

/********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/

    // Flight status codes
    uint8 private constant STATUS_CODE_UNKNOWN = 0;
    uint8 private constant STATUS_CODE_ON_TIME = 10;
    uint8 private constant STATUS_CODE_LATE_AIRLINE = 20;
    uint8 private constant STATUS_CODE_LATE_WEATHER = 30;
    uint8 private constant STATUS_CODE_LATE_TECHNICAL = 40;
    uint8 private constant STATUS_CODE_LATE_OTHER = 50;

    address private contractOwner; // address used to deploy contract
    bool private operational = true; // disallows all state changes throughout the contract if false

    mapping(address => bool) private authorizedContracts;

    struct Airline {
        bool isRegistered;
        bool isFunded;
    }
    mapping(address => Airline) private airlines;
    address[] private registeredAirlines = new address[](0);

    struct Flight {
        bool isRegistered;
        uint8 statusCode;
        uint256 updatedTimestamp;
        address airline;
        string flight;
    }
    mapping(bytes32 => Flight) private flights;
    bytes32[] private registeredFlights = new bytes32[](0);

    struct Insurance {
        address passenger;
        uint256 amount;
        bool isCredited;
    }
    // Flight key => Insurances
    mapping(bytes32 => Insurance[]) private insuredPassengersPerFlight;
    mapping(address => uint256) private pendingPayments;

    /********************************************************************************************/
    /*                                       CONSTRUCTOR                                        */
    /********************************************************************************************/

    constructor() {
        contractOwner = msg.sender;
        airlines[msg.sender] = Airline({isRegistered: true, isFunded: false});
        registeredAirlines.push(msg.sender);
    }

    /********************************************************************************************/
    /*                                       FUNCTION MODIFIERS                                 */
    /********************************************************************************************/

    // Modifiers help avoid duplication of code. They are typically used to validate something
    // before a function is allowed to be executed.

    modifier requireIsOperational() {
        require(operational, "Contract is currently not operational");
        _;
    }

    modifier requireContractOwner() {
        require(msg.sender == contractOwner, "Caller is not contract owner");
        _;
    }

    modifier requireAuthorized() {
        require(authorizedContracts[msg.sender], "Caller is not authorized");
        _;
    }

    /********************************************************************************************/
    /*                                       UTILITY FUNCTIONS                                  */
    /********************************************************************************************/

    function isOperational() public view returns (bool) {
        return operational;
    }

    function setOperatingStatus(bool mode) public requireContractOwner {
        operational = mode;
    }

    function authorizeCaller(address contractAddress)
        public
        requireContractOwner
    {
        authorizedContracts[contractAddress] = true;
    }

    function deauthorizeCaller(address contractAddress)
        public
        requireContractOwner
    {
        delete authorizedContracts[contractAddress];
    }

    /********************************************************************************************/
    /*                                     SMART CONTRACT FUNCTIONS                             */
    /********************************************************************************************/

    function registerAirline(address addr)
        external
        requireIsOperational
        requireAuthorized
    {
        airlines[addr] = Airline({isRegistered: true, isFunded: false});
        registeredAirlines.push(addr);
    }

    function isAirline(address addr)
        external
        view
        requireAuthorized
        returns (bool)
    {
        return airlines[addr].isRegistered;
    }

    function isFundedAirline(address addr)
        external
        view
        requireAuthorized
        returns (bool)
    {
        return airlines[addr].isFunded;
    }

    function getAirlinesLength()
        external
        view
        requireAuthorized
        returns (uint256)
    {
        return registeredAirlines.length;
    }

    function fundAirline(address addr)
        external
        requireIsOperational
        requireAuthorized
    {
        airlines[addr].isFunded = true;
    }

    function registerFlight(
        address airline,
        string calldata flight,
        uint256 timestamp
    ) external requireIsOperational requireAuthorized {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);
        require(
            !flights[flightKey].isRegistered,
            "Flight already registered"
        );

        flights[flightKey] = Flight({
            isRegistered: true,
            statusCode: 0,
            updatedTimestamp: timestamp,
            airline: airline,
            flight: flight
        });

        registeredFlights.push(flightKey);
    }

    function isFlight(
        address airline,
        string calldata flight,
        uint256 timestamp
    ) external view requireAuthorized returns (bool) {
        return flights[getFlightKey(airline, flight, timestamp)].isRegistered;
    }

    function isLandedFlight(
        address airline,
        string calldata flight,
        uint256 timestamp
    ) external view requireAuthorized returns (bool) {
        return
            flights[getFlightKey(airline, flight, timestamp)].statusCode >
            STATUS_CODE_UNKNOWN;
    }

    function isInsured(
        address passenger,
        address airline,
        string calldata flight,
        uint256 timestamp
    ) external view requireAuthorized returns (bool) {
        Insurance[] memory insuredPassengers = insuredPassengersPerFlight[
            getFlightKey(airline, flight, timestamp)
        ];
        for (uint256 i = 0; i < insuredPassengers.length; i++) {
            if (insuredPassengers[i].passenger == passenger) {
                return true;
            }
        }
        return false;
    }

    function processFlightStatus(
        address airline,
        string calldata flight,
        uint256 timestamp,
        uint8 statusCode
    ) external requireIsOperational requireAuthorized {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);

        if (flights[flightKey].statusCode == STATUS_CODE_UNKNOWN) {
            flights[flightKey].statusCode = statusCode;
            if (statusCode == STATUS_CODE_LATE_AIRLINE) {
                creditInsurees(airline, flight, timestamp);
            }
        }
    }

    function buy(
        address airline,
        string calldata flight,
        uint256 timestamp,
        address passenger,
        uint256 amount
    ) external requireIsOperational requireAuthorized {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);

        insuredPassengersPerFlight[flightKey].push(
            Insurance({passenger: passenger, amount: amount, isCredited: false})
        );
    }

    function creditInsurees(
        address airline,
        string memory flight,
        uint256 timestamp
    ) internal requireIsOperational {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);

        for (
            uint256 i = 0;
            i < insuredPassengersPerFlight[flightKey].length;
            i++
        ) {
            Insurance memory insurance = insuredPassengersPerFlight[flightKey][
                i
            ];

            if (insurance.isCredited == false) {
                insurance.isCredited = true;
                uint256 amount = (insurance.amount * 3) / 2;
                pendingPayments[insurance.passenger] += amount;
            }
        }
    }

    function pay(address passenger)
        external
        requireIsOperational
        requireAuthorized
        returns (uint256)
    {
        require(passenger == tx.origin, "Contracts disallowed");
        require(
            pendingPayments[passenger] > 0,
            "No available funds for withdrawal"
        );

        uint256 amount = pendingPayments[passenger];
        pendingPayments[passenger] = 0;

        payable(passenger).transfer(amount);

        return amount;
    }

    function getFlightKey(
        address airline,
        string memory flight,
        uint256 timestamp
    ) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(airline, flight, timestamp));
    }
}
